pragma solidity >=0.8 <0.9.0;
import "./Players.sol";
import "./Timed.sol";

contract GamblingPool is Players, Timed {

  modifier WhileOpen {
    require(block.timestamp >= deadline);
    _;
  }

  modifier WhileClosed {
    require(block.timestamp < deadline);
    _;
  }

  constructor() payable {
    require(msg.value > 0);
    deadline = block.timestamp + 60*1000;
  }

  function placeBet(string memory _name) payable onlyWhileOpen public {
    require(msg.value > 0);
    addPlayer(msg.sender, _name, msg.value);
  }
}
